import React from 'react'
import '../global_css/sideVideo_css/styles.css'


const sideVideo = {
  id: '#', 
  title: 'Become A Travel Pro In One Easy Lesson', 
  channel: 'Scott Cranmer', 
  image: 'type of <string>' 
};



class SideVideo extends React.Component {
  render() {
    return (
      <div className="nextVideos">
        <h4>NEXT VIDEO</h4>
      <div className="nextVideo">
        <img src="/Assets/Images/video-list-1.jpg" />
        <div className="nextVideo__info">
          <h4 className="nextVideo__title">Test</h4>
          <p className="nextVideo__channel">Another Test</p>
        </div>
      </div>

      </div>
    )
  }
}

export default SideVideo
